window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"24.1.0","implementation":{"name":"cucumber-jvm","version":"7.18.0"},"runtime":{"name":"OpenJDK 64-Bit Server VM","version":"17.0.13+11-LTS"},"os":{"name":"Windows 11"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":1733007388,"nanos":626973500}}},{"source":{"uri":"file:///D:/MARINA/SDET/GroupProject/Marina/Group6B20/src/test/resources/features/AddDependents.feature","data":"@addDependents\r\nFeature: Add Dependents to Employee Profile\r\n\r\n  Background:\r\n    When user enters admin username and admin password\r\n    And user clicks on login button\r\n    Then user is navigated to dashboard page\r\n    When the user navigates to the Employee List\r\n    And the user searches for the employee \"Oliverica\" with ID \"115585A\"\r\n    Then user clicks search button\r\n    And the employee details should be displayed\r\n    Then the user selects the employee\r\n    And the user is on the Personal Details Page\r\n    Then the user clicks on Dependent tab\r\n\r\n  @getTheUser @Olivera @group6\r\n  Scenario Outline: Add a dependent with a valid data\r\n    And the user clicks on Add button to add dependent\r\n    When the user enters dependent name as \"<name>\"\r\n    And the user selects relationship as \"<relationship>\"\r\n    And the user selects date of birth as \"<dateOfBirth>\"\r\n    Then the user clicks on \"SAVE\" button\r\n    And the dependent \"<name>\" should be added successfully\r\n    Examples:\r\n      |name          |relationship|dateOfBirth|\r\n      |Michael Lee   |Child       |2000-01-11 |\r\n      |Michael Jordan|Parent     |1960-09-11 |\r\n\r\n\r\n  @missingOrInvalidFields @Olivera @group6\r\n  Scenario Outline: Add a dependent with with missing or invalid fields\r\n    And the user clicks on Add button to add dependent\r\n    When the user sends a request to add a dependent with a following data: a dependent with \"<name>\",and \"<relationship>\"\r\n    Then the response should return \"<expectedMessage>\"\r\n    Examples:\r\n      |name          |relationship |expectedMessage |\r\n      |Mike          |             |Required        |\r\n      |Michael Lee   |Child        |Required        |\r\n      |              |Parent       |Required        |\r\n\r\n  @addMultiple @Olivera @group6\r\n  Scenario: Add multiple dependents for an employee\r\n    When the user sends a request to add a dependent with a following data:\r\n      |name          |relationship|dateOfBirth|\r\n      |Michael Smith |Spouse      |1985-01-11 |\r\n      |Michael Lee   |Child       |2000-01-11 |\r\n    Then the response should confirm all dependents were added successfully\r\n\r\n  @edit @Olivera @group6\r\n  Scenario Outline: Display dependents in the HRMS system and make sure they are editable\r\n    When the user views  the dependent list for an employee\r\n    Then the dependent list should display all added dependents\r\n    When the user selects a dependent to edit with name \"<currentName>\"\r\n    And the user updates the dependent's information as \"<newName>\"\r\n    Then the dependent information should be updated successfully\r\n    Examples:\r\n      |currentName|newName|\r\n      |Michael Lee|Michael Musk |\r\n\r\n  @delete @Olivera @group6\r\n  Scenario Outline: Verify successful deletion\r\n    When the user clicks on Dependents tab\r\n    And the user selects a dependent to delete \"<newName>\"\r\n    And the user clicks on the \"Delete\" button\r\n    Then the dependent should be removed from the list\r\n    Examples:\r\n      |newName|\r\n      |Jack Miller|","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///D:/MARINA/SDET/GroupProject/Marina/Group6B20/src/test/resources/features/AddDependents.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@addDependents","id":"9953d607-ef72-4577-baab-ebf14bb65455"}],"language":"en","keyword":"Feature","name":"Add Dependent up6\r\n  Scenario: Enable login fields with the checkbox checked\r\n    When user selects the checkbox \"Create login details\"\r\n    Then username,password,confirm password, and status field should be enabled\r\n\r\n  @checkboxChecked  @Olivera @group6\r\n  Scenario: Create login details with the checkbox checked\r\n    When user fills mandatory fields \"John\",\"Lee\" for First Name,Last Name, and Employee ID\r\n    And user selects the checkbox \"Create login details\" in the Add Employee page\r\n    Then username, password fields, and status field are enabled\r\n    When username is generated based on ID\r\n    And user enters \"SynTAX_78N\" as password\r\n    And user confirms the password \"SynTAX_78N\"\r\n    And user selects \"Enabled\" as the status from the dropdown\r\n    And there should be no error messages under password and confirm password fields\r\n    And status dropdown should display \"Enabled\"\r\n    And user clicks \"Save\"\r\n    Then user should be navigated to the Human Management System page\r\n\r\n  @passwordMismatch @Olivera @group6\r\n  Scenario: Error displayed for password mismatch\r\n    When user fills mandatory fields \"Jane\" and \"Brown\" for First Name and Last Name\r\n    And user selects the \"Create login details\"\r\n    When user sets \"jane.brown\" as username\r\n    And user enters \"PASSWORD!!pass789\" as the password\r\n    And user confirms password as \"wrongPASS123!\"\r\n    And user clicks the \"Save\" button\r\n    Then error message \"Passwords do not match\" should be visible","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///D:/MARINA/SDET/GroupProject/Marina/Group6B20/src/test/resources/features/LoginDetails.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Create login details for an employee","description":"  As an HRMS admin,\n  I want to create login credentials for employees\n  So that they can access the HRMS system w
